import { createRouter, createWebHistory } from 'vue-router';

import login from '../views/pages/pages/auth/login';

const routes = [
  {
    path: '/login',
    name: 'login',
    component: login
  }
]

export const router = createRouter({
  history: createWebHistory('/admin/'),
  linkActiveClass: 'active',
  routes,
});
